import React, {Component} from 'react';
import '../../css/index.css'

class Header extends Component {
    render (){
        return (
            <div className='header'>
                <div className='logo'>
                    <img src='../../image_folder/Desktop/logos/logo.png' />
                </div>
                <div></div>
            </div>
        );
    }
}

export default Header;
